import { useState } from 'react';
import { Search, Grid, List, ChevronDown } from 'lucide-react';
import Header from '../components/Header';
import PlayerCard from '../components/PlayerCard';
import SearchBar from '../components/SearchBar';
import { players } from '../data/players';

const MainPage = ({ navigateToPage }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedTeam, setSelectedTeam] = useState('all');
  const [ageRange, setAgeRange] = useState('all');

  const filteredPlayers = players.filter(player => {
    const matchesSearch = player.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         player.team.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTeam = selectedTeam === 'all' || player.team === selectedTeam;
    const matchesAge = ageRange === 'all' || 
                      (ageRange === 'young' && player.age < 25) ||
                      (ageRange === 'old' && player.age >= 25);

    return matchesSearch && matchesTeam && matchesAge;
  });

  return (
    <div className="min-h-screen">
      <Header navigateToPage={navigateToPage} />
      <div className="px-6 py-4">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-xl font-bold">أفضل الحراس</h1>
          <div className="flex space-x-2 space-x-reverse">
            <div className="border rounded-md p-2 flex items-center">
              <input
                type="text"
                placeholder="البحث عن لاعب..."
                className="outline-none bg-transparent w-40"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </div>
            <select
              className="border rounded-md p-2"
              value={selectedTeam}
              onChange={(e) => setSelectedTeam(e.target.value)}
            >
              <option value="all">جميع الأندية</option>
              <option value="النصر">النصر</option>
              <option value="الهلال">الهلال</option>
              <option value="الاتحاد">الاتحاد</option>
            </select>
            <select
              className="border rounded-md p-2"
              value={ageRange}
              onChange={(e) => setAgeRange(e.target.value)}
            >
              <option value="all">جميع الأعمار</option>
              <option value="young">أقل من 25</option>
              <option value="old">25 وأكثر</option>
            </select>
            <div className="flex border rounded-md">
              <button className="p-2 bg-white">
                <Grid size={16} />
              </button>
              <button className="p-2 bg-gray-100">
                <List size={16} />
              </button>
            </div>
          </div>
        </div>

        {/* Top Players */}
        <div className="mb-8">
          <div className="grid grid-cols-5 gap-4">
            {Array(5).fill().map((_, i) => (
              <div key={i} className="bg-white rounded-md p-3 shadow-sm">
                <div className="flex items-center mb-1">
                  <img src="/api/placeholder/30/30" alt="Player" className="w-8 h-8 rounded-full mr-2" />
                  <div>
                    <div className="font-bold text-sm">محمد العويس</div>
                    <div className="text-xs text-gray-500">الهلال</div>
                  </div>
                  <div className="ml-auto bg-green-100 px-2 py-1 rounded text-xs text-green-800">92%</div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Player Cards */}
        <div className="grid grid-cols-3 gap-6">
          {filteredPlayers.map((player) => (
            <PlayerCard
              key={player.id}
              player={player}
              onClick={() => navigateToPage('playerDetails', player)}
            />
          ))}
        </div>

        {/* Recent Matches */}
        <div className="mt-8">
          <h2 className="text-lg font-bold mb-4">آخر المباريات</h2>
          <div className="space-y-4">
            {Array(5).fill().map((_, i) => (
              <div key={i} className="bg-white rounded-md p-3 shadow-sm flex justify-between items-center">
                <div className="flex items-center">
                  <div className="mr-2 text-gray-400">2:1</div>
                  <div>الهلال vs النصر</div>
                </div>
                <div className="flex items-center text-green-500 text-sm">
                  <span>4 تصويبات</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
